    { id: 5, Img: "/images/5" , stat: ""},
    { id: 5, Img: "/images/5" , stat: ""},
    ])
    return(
    <div className="container">      
        { elements.map((element, index) => (
            <Card  key={index} element={element} 
            />
        ))}
     </div>
    )
}

export default Cards
